import "./App.css";
import NavBar from "./components/navBar";
import React from "react";
import { BrowserRouter } from "react-router-dom";

class App extends React.Component {
  render() {
    return (
      <React.Fragment>
        <BrowserRouter>
          <NavBar />
        </BrowserRouter>
      </React.Fragment>
    );
  }
}

export default App;
